import React from 'react';
import {  Routes, Route } from "react-router-dom";

import Formulaire from './component/formulaire';
import Cv from './component/cv';


function App(){
  return(
    <div>
      <Routes>
      <Route path="/" element={<Formulaire/>}/>
      <Route path="/cv1" element={<Cv />} />
      </Routes>

    </div>

  )
}
export default App;
